import playerRank from './PlayerRank.json'

var allPlayers = new Array(10);
const axios = require('axios').default;

function getPlayer(fullName) {
    return axios.get('https://www.balldontlie.io/api/v1/players?search=' + fullName).then((response)=>{
        return response.data
    })
}

for (var j = 1; j <= 10; j++) {
    var player = getPlayer(playerRank[j.toString()]);
    console.log(player.data[0]);
    allPlayers[j - 1] = player.data[0];
}

console.log(allPlayers[0].id);
